import { useEffect, useState } from 'react';
import './Modal.css';
import userImg from '../../Images/user.png';
import 'bootstrap/dist/css/bootstrap.min.css';

export default function Modal() {
	const [selectedImg, setSelectedImg] = useState(null);

	useEffect(() => {
		import('bootstrap/dist/js/bootstrap.bundle.min.js').then(
			(bootstrap) => {
				const modal = new bootstrap.Modal(
					document.getElementById('exampleModal')
				);
				modal.show();
			}
		);
	}, []);

	const handleImgClick = (img) => {
		setSelectedImg(img);
		return (
			<div className='outputContainer'>
				{selectedImg && (
					<div className='row flex-lg-wrap botaoPositioning '>
						<form action='/action_page.php' method='post'>
							<label className='passWordEdit' htmlFor='lname'>
								PASSWORD:
							</label>
							<input type='password' id='lname' name='lname' />
							<br />
							<div className='d-flex bd-highlight mb-3'>
								<div className='p-2 bd-highlight '>
									<div>
										<input
											type='submit'
											className='submitButton'
											id='entradaConta'
											name='entradaConta'
											value='ENTRADA'
										/>
									</div>
								</div>
								<div className='p-2 bd-highlight'>
									<div>
										<input
											type='submit'
											className='submitButton'
											id='saidaConta'
											name='saidaConta'
											value='SAIDA'
										/>
									</div>
								</div>
								<div className='ms-auto p-2 bd-highlight'>
									<div>
										<input
											type='submit'
											className='submitButton'
											id='loginConta'
											name='loginConta'
											value='LOGIN'
										/>
									</div>
								</div>
							</div>
						</form>
					</div>
				)}
			</div>
		);
	};

	return (
		<div className='Modal'>
			<div
				className='modal fade'
				id='exampleModal'
				tabIndex='-1'
				aria-labelledby='exampleModalLabel'
				aria-hidden='true'
			>
				<div className='modal-dialog modal-dialog-centered '>
					<div className='modal-content modalEdit'>
						<div className='modal-body imageContainer'>
							<div className='row d-lg-flex'>
								<div className='col-lg text-center'>
									<img
										className={`rounded-circle ${
											selectedImg === 'avatar1'
												? 'selected-img'
												: ''
										}`}
										alt='avatar1'
										src={userImg}
										onClick={() =>
											handleImgClick('avatar1')
										}
									/>
									<div className='mb-2'></div>
									<span className='text-lg-center editNames'>
										Antonio
									</span>
								</div>
								<div className='col-lg text-center'>
									<img
										className={`rounded-circle ${
											selectedImg === 'avatar2'
												? 'selected-img'
												: ''
										}`}
										alt='avatar2'
										src={userImg}
										onClick={() =>
											handleImgClick('avatar2')
										}
									/>
									<div className='mb-2'></div>
									<span className='text-lg-center editNames'>
										Micaela
									</span>
								</div>
								<div className='col-lg text-center'>
									<img
										className={`rounded-circle ${
											selectedImg === 'avatar3'
												? 'selected-img'
												: ''
										}`}
										alt='avatar3'
										src={userImg}
										onClick={() =>
											handleImgClick('avatar3')
										}
									/>
									<div className='mb-2'></div>
									<span className='text-lg-center editNames'>
										Michelle
									</span>
								</div>
								<div className='col-lg text-center'>
									<img
										className={`rounded-circle ${
											selectedImg === 'avatar4'
												? 'selected-img'
												: ''
										}`}
										alt='avatar4'
										src={userImg}
										onClick={() =>
											handleImgClick('avatar4')
										}
									/>
									<div className='mb-2'></div>
									<span className='text-lg-center editNames'>
										Santiago
									</span>
								</div>
							</div>
						</div>
					</div>
				</div>
			</div>
		</div>
	);
}
